import React, { useContext } from 'react'
import {Button,
    Container, Col, Row, 
    Card} from 'react-bootstrap'
import AppContext from '../../context'

export default function Cart(props) {

    const context = useContext(AppContext)

    return(
        <div>
            <h1>Cart</h1>
            <Table striped bordered hover>
                <thead>
                    <th></th>
                    <th>Product</th>
                    <th>Price</th>
                    <th>Quantity</th>
                    <th>Total</th>
                </thead>
                <tbody>
                    {context.cart.map((p) => {
                        <td></td>
                    })} 
                </tbody>
            </Table>

        </div>
    )
}
